// import React from 'react';
import React, { useState } from 'react';
import './App.css';
import { MyExampleComponent } from './components/MyExampleComponent';
import { InputComponent } from './InputComponent';
import CounterComponent2 from './CounterComponent2';
import MyWrapper from './components/MyWrapper';
// import InputWithSave from './components/InputWithSave';

// type SetStateNumberType = (arg1: number) => void
// type SetStateNumberType = React.Dispatch<React.SetStateAction<number>>
// type UseCountLimitReturn = [number, SetStateNumberType]

// function useCountWithLimit (limit: number) : UseCountLimitReturn {
//   const [count,setCount] = useState(0)

//   let value = count
//   if(count > limit) {
//     value = limit
//   }
//   return [value, setCount]
// }


function Canvas() {
  const [coord, setCoord] = useState({x: NaN, y: NaN})

  function tracking(x: number, y:number) {
    setCoord({x, y})
  }

  return <><div
  className='myCanvas'
  onMouseEnter={(e) => tracking(e.clientX, e.clientY)}
  onMouseLeave={() => console.log({x:NaN, y:NaN})}
  onMouseMove={(e) => tracking(e.clientX, e.clientY)}
  >
  </div>
  <div>X: {coord.x}</div>
  <div>Y: {coord.y}</div>
  </>

}


function CounterComponent1() {
  const [count, setCount] = useState( {counter1: 0, counter2: 0} )
  return (
    <div className='wrapperDiv'>
    <button onClick = {() => setCount(a => {
      return {
      ...a,
      counter1: a.counter1 + 1
    }
    })}>
      btn 1
    </button>
    <p>1 counter: <span>{count.counter1}</span></p>
    <button onClick = {() => setCount(a =>({
      ...a,
      counter2: a.counter2 + 1
    }))}>
      btn 2
    </button>
    <p>2 counter: <span>{count.counter2}</span></p>
      </div>
  )
}


const obj: {name:string; year:string} = {
  name:'Lesson',
  year:'2025',
}

function Inner(props: { year: string} ) {
  return (
    <div>
      <h2>date start {props.year}</h2>
    </div>
  )
}

function Test(props: { name: string; year: string}) {
  return (
    <div>
      <h1>start project {props.name}</h1>
      <Inner year = {props.year}/>
    </div>
  )
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Test {...obj}/>
        {/* <img src={logo} className="App-logo" alt="logo" /> */}
        <p>
          Edit <code>src/App.js</code> HELLO
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>

      {/* <InputWithSave/> */}
        <Canvas/>
        <MyExampleComponent/>
        <MyWrapper>
        <CounterComponent1/>
        <CounterComponent2/>
        <InputComponent/>
        </MyWrapper>
      </header>
    </div>
  );
}

export default App;
